description:
Verenigde Staten
Horror / Thriller
82 minuten

goed en heftig

met Bobby Campo, Shantel VanSanten en Nick Zano

Nick en een paar vrienden gaan voor het weekend naar een circuit om een autorace te bekijken. Er gebeurt echter een 
verschrikkelijk ongeluk. Een auto rijdt met hoge snelheid het publiek in. Er vallen veel doden en het lijkt er zelfs op dat het 
stadion in elkaar gaat vallen, totdat Nick erachter komt dat het maar een visioen was. Hij besluit om samen met zijn vrienden te 
vluchten voor wat komen gaat, maar de ''dood'' zal de overlevenden blijven achtervolgen om alles wat gebeurd zou moeten zijn, 
recht te zetten.
